import React from 'react';

import './Events.css';

function Events(props) {
  return (
    <li className={'events'}>
      <h2>{props.name}</h2>
      <h3>{props.startDate}</h3>
      <p>{props.view}</p>
      <iframe width='400px' height='400px' src={props.url}></iframe>
      <button target='_blank' href={props.url}>
        See More
      </button>
    </li>
  );
}

export default Events;
